Defendant Jennifer M Munson in court with Attorney Michael L. Chernin.  
Joy Hammond appeared for the State of Wisconsin.  
Deputy Court Clerk: dds.

AS TO COUNT 1:

Defendant was advised of constitutional rights and maximum penalties, waived all rights, plead GUILTY and was examined as to the plea.  Plea Questionnaire/Waiver of Rights, Addendum, and Elements Sheet, received and filed.  Parties stipulate to the complaint as a factual basis for the plea.  Court found defendant guilty as charged and ordered entry of Judgment of Conviction.

Statements made as to sentencing by the state, defense, and defendant.

The Court orders the defendant to serve 6 MONTHS in the House of Correction STRAIGHT TIME, NO ELECTRONIC MONITORING.

The Court STAYED this sentence and placed the defendant on PROBATION for a period of 12 MONTHS with the following conditions.

CONDITIONS OF PROBATION:
*Obtain AODA assessment and complete follow-up care/treatment;
*Absolute sobriety with random urine screens;
*Full time employment or full time school or combination of both;
*Pay all applicable mandatory surcharges, fees, assessments, and costs by the end of probation period- any remaining balance to convert to civil judgment;

Filed:
- Offer letter;
-Notice of Right to Seek Postconviction Relief.
